import './App.scss';
import Deprem from './components/Deprem';



function App() {


  return (
    <>

<nav className="navbar">

    <a href="#">
        <h2 className="logo"><b>DEP<span>REM</span></b></h2>
    </a>
    <ul>
        <li><Link to="/">Deprem Raporları</Link></li>
        <li><a href="./Yardım Kuruluşları.html">Yardım Kuruluşları</a></li>
        <li><a href="./Toplanma Alanları.html">Toplanma Alanları</a></li>
        <li><a href="./Tweetler.html">Tweetler</a></li>
        <li><a href="#contact">İletişim</a></li>
    </ul>
</nav>
    <Routes>
      <Route path='/' element={<Deprem />} />
    </Routes>
  </>
  );
}

export default App;
